import React from 'react';
import './Home.css';

function Home() {
    return (
        <div classname="HomeContent">
        <h1>FretFinder</h1>
        <p>The place to find your notes.</p>
        <a href="/Fretboard"><img src ="https://i.ytimg.com/vi/0jLTQLREBQk/maxresdefault.jpg"></img></a>

      </div>
    )
}

export default Home;
